import React from "react";
import Featuredbox from "./Featuredbox";
import feature1 from '../../images/feature_1.png'
import feature2 from '../../images/feature_2.png'
import feature3 from '../../images/feature_3.png'

function Feature () {
    return (
        <div id="features">
           <div className="a-container">
               <Featuredbox image={feature1} title="Development Course"/>
               <Featuredbox image={feature2} title="Development Course"/>
               <Featuredbox image={feature3} title="Development Course"/>

           </div>
        </div>
    )
}
export default Feature;
